/* pag89 
 * app que muestre las tablas de multiplicar del 1 al 10
 */
public class J45 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for(int i=0;i<11;i++) {
			for(int j=0;j<11;j++) {	
			System.out.println(i+"*"+j+"="+i*j);
			}
			
		}
	}

}
